import React from 'react';

import { MenuDropdown } from './MenuDropdown';

export default {
  title: 'Example/Molecules/Dropdowns',
  component: MenuDropdown,
};

const Template = (args) => <MenuDropdown {...args} />;

export const MenuItem = Template.bind({});
